import './navbar.css';
import menuIcon from '../img/user_pic.png';
import menuIconOver from '../img/user_pic_hover.png';

const NavBar = () => {
    return (

        <div className = "container">
            <div className= "con_logo">
                Appart
            </div>
            <div className="cont_login">
                <ul>
                    <p>Ë…</p>
                    <div>
                        <img src={menuIcon} alt="" onMouseOver/>
                    </div>

                    <li>ContactUs</li>
                    <li>Login</li>
                </ul>
            </div>
        </div>
    );
};

export default NavBar;
